paragraphs.text:
%md
We are going to use the new movie database and do a describe on the tables listed  below

~~~console
use movie;
describe movie_title_stage;
describe movie_crew_stage;
describe movie_crew_info_stage;
describe rating_stage;
~~~

Also, try some queries on the tables for practice. Limit your data to 5 rows.

%jdbc(hive_interactive)
use movie;
describe movie_title_stage;
describe movie_crew_stage;
describe movie_crew_info_stage;
describe rating_stage;

%jdbc(hive_interactive)
SELECT count(*) AS movie_title_count FROM movie_title_stage;
SELECT count(*) AS movie_crew_count FROM movie_crew_stage;
SELECT count(*) AS movie_crew_info_count FROM movie_crew_info_stage;
SELECT count(*) AS rating_count FROM rating_stage;

%jdbc(hive_interactive)
USE movie;
INSERT INTO TABLE movie_title_partition
PARTITION(startYear)
SELECT tconst,titleType,primaryTitle,originalTitle,isAdult,endYear,runtimeMinutes,genres,startYear
FROM movie_title_stage;

%jdbc(hive_interactive)
--The table must be stored as ORC and be transactional to perform delete
CREATE TABLE movie_crew stored AS ORC AS SELECT * FROM movie_crew_info_partition;
ALTER TABLE movie_crew SET TBLPROPERTIES ('transactional'='true'); 
DELETE FROM movie_crew WHERE birthYear=1959;
SELECT * FROM movie_crew WHERE birthYear=1959;
